import React from 'react';
import directory from '../directory/directory.component';

class menu extends React.Component{
    constructor(){
        super();

        this.state = {
            secton:[
                {
                    title:'hat',
                    id : 1
                },
                {
                    title:'cap',
                    id: 2
                },
                {
                    title:'mask',
                    id: 3
                },
                {
                    title:'glove',
                    id: 4
                },
                {
                    title:'shocks',
                    id: 5
                },
            ]
        }
    }

render(){
    return(
<div className="menu">
    {
    this.state.section.map(({title,id}) =>(
        <directory key={id} title={title} />

    ))
}
    </div>

    )



}
}

export default menu;
